    false,nt"url": null,nt"notes": "In 2014/2015 a cooperative effort between
    Stewart B. McKinney National Wildlife Refuge (SBMNWR) and the Connecticut Department
    of Energy and Environmental Protection, Wildlife Division (DEEP),   with financial
    assistance from United States Fish and Wildlife Service National Wildlife Refuge
    System, allowed for the collection of CWD samples.  Active surveillance involved
    collecting samples from each of Connecticutu2019s thirteen Deer Management Zones
    in proportion to zonal deer densities to obtain a statistically valid sample with
    95% confidence of detecting the disease at the 1% prevalence level (Table 1).  All
    total of 325 samples were collected from hunter-harvested deer at deer check stations,
    butcher shops, and from deer killed by motor vehicle.  All samples were submitted
    for testing at Colorado State University and results are still pending.",nt"license_title":
